import React from "react";
import '../sliders/slider.css';
import Slider from "react-slick";

export default function SliderMove(props) {
const {slides} = props;
const settings = {
    dots: false,
    infinite: true,
    speed: 500,
    slidesToShow: 4,
    slidesToScroll: 1
  };



    return (
        <Slider {...settings}>
            {
                slides.map(
                    slide => {
                        return <a  className="slide">

                            <img className="slideImg" key = {slide} src={slide.image} alt={''}></img> 
                            </a>

                    }
                )
            }
        </Slider>
    )
}
